import React from "react";
function App() {
  const onStartHandling = () => {
    fetch("http://127.0.0.1:5000")
      .then((response) => {
        console.log(1);
        console.log(response);
        if (response !== 0) {
          console.log(2);
        }
        response.json();
      })
      .then((resData) => {
        console.log(resData);
        console.log(typeof resData);
      });
  };

  return <button onClick={() => onStartHandling()}>Start</button>;
}

export default App;
